// ------------------------------
// Make API call, draw diagram
//-------------------------------
function main(inputValue){

  loadingFunction(); // Show loading spinner

  url = "https://python-dependency-api.herokuapp.com/api/python/" + inputValue
  // url = "http://127.0.0.1:5000/api/python/" + inputValue

  d3.json(url).then(function(data){

    if (data == null){
      d3.select("#no-dependencies").selectAll("*").remove() // remove everything that's already there
      d3.select("#module-description").selectAll("*").remove() // remove everything that's already there
      d3.select("#module-extras").selectAll("*").remove() // remove everything that's already there
      d3.select("#tree").selectAll("*").remove() // remove everything that's already there
      d3.select("#module-description").insert("h4")
      .html(`<br>There is no module with name <strong>${inputValue}</strong> on the <a href = "https://pypi.org/" target="_blank">
      Python Package Index</a>. Please search for another module`)//.style("color", "#1f77b4") // print an error message
      completionFunction(); // End loading spinner
    }
    else{
      make_tree(data);
    }

  }); // Load data in json form

}

//-------------------------------------------------
// Parse PyPI Date string
//-------------------------------------------------
function parseDate(s) {
  var d = new Date();
  s = s.split('T'); // split into date and time
  s = s[0].split('-'); // split into date into year, month, day
  d.setFullYear(s[0]);
  d.setMonth(parseInt(s[1]) - 1);
  d.setDate(s[2]);
  return d;
}

//-------------------------------------------------
// Random Module
//-------------------------------------------------
function randomModule(){
  var randModule = top_modules[Math.floor(Math.random() * 4000)]; // returns a random module from the top 4000 most downloaded
  onSubmit(randModule);
}

//-------------------------------------------------
// Make Tree Diagram and other info elements
//-------------------------------------------------
function make_tree(data){
  // console.log(data)

  d3.select("#no-dependencies").selectAll("*").remove() // remove everything that's already there

  d3.select("#more-info").selectAll("*").remove() // remove everything that's already there

  d3.select("#module-description").selectAll("*").remove() // remove everything that's already there

  d3.select("#module-extras").selectAll("*").remove() // remove everything that's already there

  d3.select("#tree").selectAll("*").remove() // remove everything that's already there

  treeData = data["dependency_tree"]
  if (data.info.summary == "" || data.info.summary == null ){
    summary = `Summary: ${data.description.substring(0,70)}...<a href="" id="moreLessInfo">more info</a>`;
  }
  else {
    summary = `Summary: ${data.info.summary} <br><a href="" id="moreLessInfo">more info</a>`;
  }
  var mysvg = chart(treeData)

  function resolveAfterTimeAction() {
    return new Promise(resolve => {
      setTimeout(() => {
        d3.select("#tree").node().append(mysvg);
        resolve('resolved');
      }, 750);
    });
  }

  async function asyncCall() {
    console.log('calling');
    var result = await resolveAfterTimeAction();
  }

  try{asyncCall();}
  catch{console.log("async call failed")}

  if (data.dependency_tree.children == null){
    d3.select("#no-dependencies").insert("p")
    .html(`<br>(${data.name} requires no other modules.)`)//.style("color", "#1f77b4") // Plotly "muted blue"
  }
  
  d3.select("#module-description").insert("h4")
  .html(`${summary}`)//.style("color", "#1f77b4") // Plotly "muted blue"

  var moreLessInfo = d3.select("#moreLessInfo");
  var infoState = false;

  moreLessInfo.on("click", function(){
    d3.event.preventDefault();

    if (infoState == false){

      d3.select("#more-info").insert("p")
      .html(`${data.description}`)//.style("color", "#1f77b4") // Plotly "muted blue"

      moreLessInfo
      .text("less info")//.style("color", "#1f77b4") // Plotly "muted blue"

      infoState = true;
    }

    else{

      d3.select("#more-info").selectAll("*").remove() // remove everything that's already there

      moreLessInfo
      .text("more info")//.style("color", "#1f77b4") // Plotly "muted blue"

      infoState = false;

    }

  });

  if (data.requires_python == "" || data.requires_python == false){
    requiresPython = "(none specified)";
  }
  else {
    requiresPython = data.requires_python;
  }

  if (data.home_page == "" || data.home_page == false){
    homepage = `https://pypi.org/project/${data.name}/`;
  }
  else {
    homepage = data.home_page;
  }

  var sourceModified = new Date(0);
  var wheelModified = new Date(0);
  var sourceSize = 0;
  var totalWheel = 0;
  var avgWheel = 0;
  var wheelCount = 0;
  var sizeMessage = "";
  var modifiedMessage = "";

  data.download_sizes.forEach(function(element){
    if (element.packagetype == "sdist"){
      sourceSize += parseInt(element.size)/1000;
      thisDate = parseDate(element.date);
      if (thisDate > sourceModified){
        sourceModified = thisDate;
      }
    }
    else {
      totalWheel += parseInt(element.size)/1000;
      wheelCount ++;
      thisDate = parseDate(element.date);
      if (thisDate > wheelModified){
        wheelModified = thisDate;
      }

    }
  });

  if (wheelCount != 0){
    avgWheel = totalWheel / wheelCount;
  }

  if (sourceSize == 0){
    sizeMessage = `<br><br>Average Wheel Size: <strong>${Math.round(avgWheel)} KB</strong>`;
    modifiedMessage = `<br><br>Last Updated: <strong>${wheelModified.toDateString()}</strong>`;
  }
  else{
    sizeMessage = `  <br><br>Source Code Size: <strong>${Math.round(sourceSize)} KB</strong>`;
    modifiedMessage = `<br><br>Last Updated: <strong>${sourceModified.toDateString()}</strong>`;
  }
  
  d3.select("#module-extras").insert("p")
  .html(`<br>Home: <a href="${homepage}" target="_blank"><strong>${homepage}</strong></a>
  <br><br>Latest Version: <strong>${data.latest_release}</strong>
  <br><br>Requires Python Version: <strong>${requiresPython}</strong>
  ${modifiedMessage}
  ${sizeMessage}
  `)// .style("color", "#1f77b4") // Plotly "muted blue"

  completionFunction(); // End loading spinner

}

//------------------------------------------------------------
// Wait for page to load, add event listeners on user inputs
//------------------------------------------------------------
setTimeout(function() { 

  var button = d3.select("#searchButton");

  // Select the input element and get the raw HTML node
  var inputElement = d3.select("#theInput");

  var luckyClick = d3.select("#luckyClick");

  luckyClick.on("click", function(){
    d3.event.preventDefault();
    randomModule();
  });

  
  button.on("click", function() {
    // Get the value property of the input element
    var inputValue = inputElement.property("value");
    onSubmit(inputValue); 

  });

  // Execute a function when the user releases a key on the keyboard
  inputElement.on("keyup", function(event) {
    // Number 13 is the "Enter" key on the keyboard
    if (d3.event.keyCode === 13) {
      // Cancel the default action, if needed
      d3.event.preventDefault();
      // Trigger the button element with a click
      document.getElementById("searchButton").click();
    }
  });

}, 1000)

//------------------------------------------------------------------------------
// On a submission of any kind, call the main, if false submission show a hint 
//------------------------------------------------------------------------------
function onSubmit(inputValue){


  if (inputValue != ""){
    d3.select("#theInput")
    .attr("placeholder", inputValue);
    main(inputValue);
  }
  else {
    d3.select("#theInput")
    .attr("placeholder", "Enter a Python module name here, e.g. pandas");
  }

}


//------------------------------------------------------------------------------
// Show loading status while pulling data from the backend
//------------------------------------------------------------------------------
function loadingFunction() {
  var x = document.getElementById("loadingButton");
  if (x.style.display === "none") {
    x.style.display = "block";
  }

  var y = document.getElementById("searchButton");
  if (y.style.display !== "none") {
    y.style.display = "none";
  }
}

//------------------------------------------------------------------------------
// Hide loading status upon response from the backend
//------------------------------------------------------------------------------
function completionFunction() {
  var x = document.getElementById("searchButton");
  if (x.style.display === "none") {
    x.style.display = "block";
  }

  var y = document.getElementById("loadingButton");
  if (y.style.display !== "none") {
    y.style.display = "none";
  }
}

