// Draw collapisble tree with json data
function chart(data){

  // Define the div for the tooltip
  var tooltipDiv = d3.select("body").append("div")	
  .attr("class", "treeTooltip")				
  .style("opacity", 0);

  //var width = document.getElementById('tree').offsetWidth
  var w = document.getElementById('tree-div').getBoundingClientRect().width;  
  var h = document.getElementById('tree-div').getBoundingClientRect().height;
  //console.log("width: ", w, " height: ", h)

  sizingScale = w / 1140;

  // leftMargin = Math.pow(len, 0.85) * 1.75 + 30 * sizingScale; // vary the left margin based on the lenght of the module
  try{var tree_label_width = document.getElementById(`${data.name}`).getBoundingClientRect().width;}
  catch{var tree_label_width = 0}  

  leftMargin = tree_label_width;
  
  //console.log(leftMargin)
  margin = ({top: 10 * sizingScale, right: 50 * sizingScale, bottom: 10 * sizingScale, left: 50 * sizingScale}); // set margins

  var maxWidth = w - margin.left - margin.right; // set chart width

  diagonal = d3.linkHorizontal().x(d => d.y).y(d => d.x); // horizontal links

  dx = 30 * sizingScale; // controls vertical spacing

  dy = 300 * sizingScale; // controls horizontal spacing. Chosen to fit two nodes on iphone

  tree = d3.tree().nodeSize([dx, dy]); // Create a tree layout with node sizes specified as above

  const root = d3.hierarchy(data); // Create hierarchy objecy

  root.x0 = dy / 2; //dy / 2; // margin off the left of the container

  root.y0 = 0; // margin off the top of the container

  root.descendants().forEach((d, i) => {
    //console.log(d)
    d.id = i;
    d._children = d.children;
    if (d.depth && d.data.name.length !== 1) d.children = null; // If the depth and name length are not integers, set the children to null
  });

  const svg = d3.create("svg")
      .attr("viewBox", [-margin.left, -margin.top, maxWidth, dx]) 
      .style("font", `${16 * Math.pow(sizingScale, 0.75)}px sans-serif`) // controls text size
      .style("user-select", "none");

  const gLink = svg.append("g")
      .attr("fill", "none")
      .attr("stroke", "#555")
      .attr("stroke-opacity", 0.4)
      .attr("stroke-width", 1.5);

  const gNode = svg.append("g")
      .attr("cursor", "pointer")
      .attr("pointer-events", "all")
      .attr("id", "tree-bounding-g");

  function update(source) {
    function isTouchDevice(){
      return true == ("ontouchstart" in window || window.DocumentTouch && document instanceof DocumentTouch);
    }

    const duration = d3.event && d3.event.altKey ? 2500 : 250; // If the user is holding the ALT key, transition everything 10x as slow
    const nodes = root.descendants().reverse(); // Descendets are orderd first by level, then alphabetically
    const links = root.links();

    // Get label width
    try{tree_label_width = document.getElementById(`${data.name}`).getBoundingClientRect().width;}

    catch{tree_label_width = 0;}

    // Compute the new tree layout.
    tree(root);

    let left = root;
    let right = root;

    let top = root;
    let bottom = root;

    // for horizontal tree, imagine the diagram rotated right 90 degrees
    root.eachBefore(node => {
      if (node.x < left.x) left = node; // find the vertical displacement of the node at the top of the tree
      if (node.x > right.x) right = node; // find the vertical displacement of the node at the bottom of the tree
    });

    root.eachBefore(node => {
      if (node.y < bottom.y) bottom = node; // find the horizontal displacement of the node at the left of the tree
      if (node.y > top.y) top = node; // find the horizontal displacement of the node at the bottom of the tree
    });

    //console.log("bottom.y:", bottom.y, "top.y:", top.y)
    const height = right.x - left.x + margin.top + margin.bottom; // height is the tree size + the margins

    treeWidth = top.y + dy + margin.left;
    //console.log("treeWidth:", treeWidth, "maxWidth: ", maxWidth)
    var leftOffset =  tree_label_width;

    if (treeWidth > maxWidth){
      leftOffset = +(treeWidth - maxWidth) - tree_label_width;
      
    }
    else {
      leftOffset = -tree_label_width;
    }
    
    const transition = svg.transition()
        .ease(d3.easeSin)
        .duration(duration)
        .attr("viewBox", [leftOffset, left.x - margin.top, maxWidth, height]) // left offset, top offset = half the tree size, 
        .tween("resize", window.ResizeObserver ? null : () => () => svg.dispatch("toggle"));

    // Update the nodes…
    const node = gNode.selectAll("g")
      .data(nodes, d => d.id);

    // Enter any new nodes at the parent's previous position.
    const nodeEnter = node.enter().append("g")
        .attr("id", d => d.data.name)
        .attr("transform", d => `translate(${source.y0},${source.x0})`)
        .attr("fill-opacity", 0)
        .attr("stroke-opacity", 0)
        .on("click", d => {
          d.children = d.children ? null : d._children;
          update(d);
        })
        .on("mouseover", function(d) {		
          tooltipDiv.transition()
          .ease(d3.easeSin)
          .delay(1000)	
          .duration(350)		
          .style("opacity", isTouchDevice() ? 0 : 1)
        })
        .on("mousemove", function(d) {			
          tooltipDiv.html(d.data.name + ": " + d.data.summary)	
          .style("left", ((d3.event.pageX) + 10) + "px")		
          .style("top", ((d3.event.pageY)-45) + "px")
          .style("overflow-wrap", "break-word")
          .style("text-align", "left")
          })         
        .on("mouseout", function(d) {		
          tooltipDiv.transition()
              .ease(d3.easeSin)		
              .duration(200)		
              .style("opacity", 0);
        });

    nodeEnter.append("circle")
        .attr("r", 5 * sizingScale) // controls circle size
        .attr("fill", d => d._children ? "blue" : "#999") // if it has dependents show in hyperlink blue, otherwise gray
        .attr("stroke-width", 1)
        .attr("stroke", d => d._children ? "black" : "white");

    nodeEnter.append("text")
        .attr("dy", "0.31em") // controls vertical displacement
        .attr("x", d => d.data.name == data.name ? -8 * sizingScale : 8 * sizingScale) // controls spacing from circles
        .attr("text-anchor", d => d.data.name == data.name ? "end" : "start")
        .text(d => d.data.name)
      .clone(true).lower()
        .attr("stroke-linejoin", "round")
        .attr("stroke-width", 3)
        .attr("stroke", "white")

    // Transition nodes to their new position.
    const nodeUpdate = node.merge(nodeEnter).transition(transition)
        .attr("transform", d => `translate(${d.y},${d.x})`)
        .attr("fill-opacity", 1)
        .attr("stroke-opacity", 1);

    // Transition exiting nodes to the parent's new position.
    const nodeExit = node.exit().transition(transition).remove()
        .attr("transform", d => `translate(${source.y},${source.x})`)
        .attr("fill-opacity", 0)
        .attr("stroke-opacity", 0);

    // Update the links…
    const link = gLink.selectAll("path")
      .data(links, d => d.target.id);

    // Enter any new links at the parent's previous position.
    const linkEnter = link.enter().append("path")
        .attr("d", d => {
          const o = {x: source.x0, y: source.y0};
          return diagonal({source: o, target: o});
        });

    // Transition links to their new position.
    link.merge(linkEnter).transition(transition)
        .attr("d", diagonal);

    // Transition exiting nodes to the parent's new position.
    link.exit().transition(transition).remove()
        .attr("d", d => {
          const o = {x: source.x, y: source.y};
          return diagonal({source: o, target: o});
        });

    // Stash the old positions for transition.
    root.eachBefore(d => {
      d.x0 = d.x;
      d.y0 = d.y;
    });

  }

  update(root);

  setTimeout(() => {
    update(root);
  }, 1000);

  return svg.node();
}


